import java.util.HashMap;
import java.util.Scanner;

class  Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long[] powers = new long[n + 1];
        long[] symbols = new long[n + 1];
        for (int i = 1; i <= n; i++) {
            powers[i] = sc.nextLong();
        }

        for (int i = 1; i <= n; i++) {
            symbols[i] = sc.nextLong();
        }

        HashMap<Long, Integer> savePosPre = new HashMap<>();
        long[][] save = new long[n + 1][2];
        save[0][1] = -1;
        for (int i = 1; i <= n; i++) {
            long tempt = powers[i] + save[i - 1][0];
            if (savePosPre.get(symbols[i]) != null) {
                int tempt2 = savePosPre.get(symbols[i]);
                savePosPre.put(symbols[i], i);
                if (save[tempt2][1] > save[i - 1][1]) {
                    save[i][1] = save[i - 1][1] + 1;
                    save[i][0] = tempt;
                } else if (save[tempt2][1] < save[i - 1][1]) {
                    save[i][1] = save[tempt2][1] + 1;
                    save[i][0] = save[tempt2][0] - (i - tempt2) + powers[i];
                } else {
                    save[i][1] = save[i - 1][1] + 1;
                    save[i][0] = Math.max(save[tempt2][0] - (i - tempt2) + powers[i], tempt);
                }
            } else {
                savePosPre.put(symbols[i], i);
                save[i][0] = tempt;
                save[i][1] = save[i - 1][1] + 1;
            }
        }
        System.out.println(save[n][1] + " " + save[n][0]);

    }
}
